import Link from 'next/link';
import Grid from '@material-ui/core/Grid';

const Home = () => {
    return(
        <React.Fragement>
            <Grid container spacing={1}>
                <Grid item xs={2}>
                    <div>111</div>
                </Grid>
                <Grid item xs={2}>
                    <div>222</div>
                </Grid>
            </Grid>
        </React.Fragement>
    );
}

export default Home;
